import React , {useEffect , useState} from 'react'
import edit_btn from '../icons/edit_btn.svg'
import adding from '../icons/adding.svg'
import left_arrow from '../icons/left_arrow.svg'
import {useParams } from "react-router-dom"
import x_marque from '../icons/x_marque.svg'
import axios from 'axios'

function Project() {
    const params = useParams() ;
    const [data , setDate] = useState()
    const project_id = params.id
    const [update , setUpdate]= useState(false)


    useEffect(()=>{
        getData();
      },[update])    
      let getData = async () => {

        let respons = await fetch (`http://127.0.0.1:8000/task/${project_id}`)
        let data = await respons.json()
        setDate(data)

    }

    const [name , setName ] = useState('')
    const [DDL , setDDL] = useState('')
    const [x_marque_bol , set_x_marque] = useState(false)

    
    const handleSumbit_task = async ()=> {
        const DataForm= new FormData();
        DataForm.append('name',name)        
        DataForm.append('DDL',DDL)        
    
        await axios ({
          method : 'post' , 
          url : 'http://127.0.0.1:8000/task/'+project_id ,
          data :  DataForm
      })
      .then((response)=>{
          console.log(response.data) ;
      }) .catch(function (error) {
          console.log(error)
        });
        setUpdate(!update)
      }

      const save_task_exit =()=> {
        handleSumbit_task()
        setName('')
        setDDL('')
        set_x_marque(false)
      }
      console.log('------')
      console.log(data)
      console.log('------')
  return (
    <div className='Project' >
            {
                x_marque_bol ?
             <div className='form_container center'>
                <div className='form center'  >
                  <img className='x_marque' src={x_marque} onClick={()=>set_x_marque(false)}  />
                    <div className='box'>
                      <p>Task name  </p>
                      <input value={name} onChange={(e)=>setName(e.target.value)}  />
                    </div>
                    <div className='box'>
                      <p>Dead Line  </p>
                      <input value={DDL} onChange={(e)=>setDDL(e.target.value)} type='date' />
                    </div>
                    <div className='btns'>
                        <button onClick={()=>save_task_exit()} >Save & exit </button>
                        <button  >+ steps</button>
                    </div>
                </div>
            </div>
            : ''
            }   

         <a href='/' className='add_task center'>
            <img src={left_arrow} className='back_arrow'  /> Back
        </a>
        <div className='header spacebetween'>
            <div className='proj_name center'>
                <h3> {data?.['name']} </h3>
                <p className='perc center'> 25% <span>1/3</span>  </p>
            </div>
            <div className='DDL center'> 
                    <p><span>DDL</span> in 09/01/2080</p>
                    <img src={edit_btn} />
            </div>

        </div>

        <div className='add_task center' onClick={()=>set_x_marque(true)}>
            <img src={adding}  /> Add task  
        </div>
            {
                data?.['tasks']
            }
        <div className='task center'>
            <div className='container center'>
                <div className='taskname center'> task  <img src={edit_btn} />  </div>
                <p className='perc center'> 25% <span>1/3</span>  </p>
            </div>
            <div className='steps center'>
                    <p className='center'>step n</p>
                    <p className='center check'>step n</p>
                    <p className='center'>step n</p>
            </div>
        </div>


    </div>
  )
}

export default Project
